import React from 'react';

//Routing
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
//^i think i fixed the issue, matched 'react-router' and 'react-router-dom' to latest version in package.json, then instead of importing Routers I imported Switch

//Components
import Header from './components/Header';
import Home from './components/Home';

//Styling
import {GlobalStyle} from './GlobalStyle'

const App = () => (
    <Router>
        <Header/>
        <Switch>
            <Route path='/' element={<Home/>}/>
            <Route path='/'></Route>
        </Switch>
        <Home/>
        <GlobalStyle/>
    </Router>
);

export default App;
